#include<stdio.h>
int main()
{
    int numOfLet,j,i,a;
    scanf("%d",&numOfLet);
    char s[numOfLet];
    scanf("%s",&s);
    char curPair[2*numOfLet];
    int count[(numOfLet-1)];
    int countFix[(numOfLet-1)];
    for(i=0; i<(numOfLet-1); i++)
    {
        count[i]=0;
    }
    for(i=0; i<(numOfLet-1); i++)
    {
        curPair[i*2]=s[i];
        curPair[(i*2)+1]=s[i+1];
        for(j=0; j<numOfLet; j++)
        {
            if(curPair[0]==s[j]&&curPair[1]==s[j+1])
            {
                count[j]++;
            }
            countFix[j]=count[j];
            for (i = 0; i < numOfLet; ++i)
            {

                for (j = i + 1; j < numOfLet; ++j)
                {

                    if (count[i] > count[j])
                    {

                        a =  count[i];
                        count[i] = count[j];
                        count[j] = a;

                    }

                }

            }


        }
        for(i=0; i<(numOfLet-1); i++)
        {
            if(countFix[0]==count[i])
            {
                printf("%c%c",curPair[i*2],curPair[(i*2)+1]);
                return 0;
            }
        }

    }



}
